import * as React from 'react';
import { NextPage, NextPageContext } from 'next';

interface Props {
    title: string
}

const Index: NextPage<Props> = ({ title }) => {
    const greetName = title ? title : 'World';
    return <div>Hello!!!!!!!!!, {greetName}!</div>;
};

Index.getInitialProps = async (ctx: NextPageContext | any) => {
    const { title } = ctx;
    return { title };
};

export default Index;
